value.dataVInicial:
={{
  (() => {
    let d = new Date();
    d.setDate(d.getDate() - 5); // começa 5 dia após o vencimento

    // enquanto for segunda (1), retrocede + 9 dias
    while (d.getDay() === 1) {
      d.setDate(d.getDate() - 8);
    }

    // formata para dd/MM/yyyy
    const dd = String(d.getDate()).padStart(2, '0');
    const mm = String(d.getMonth() + 1).padStart(2, '0');
    const yyyy = d.getFullYear();

    return `${dd}/${mm}/${yyyy}`;
  })()
}}

